const csv = require('csv-parser');
const fs = require('fs-extra');

let data = [];

fs.createReadStream('tmk2.csv')
  .pipe(csv())
  .on('data', (row) => {
    console.log(row)
    data.push(row);
  })
  .on('end', () => {
    console.log('CSV file successfully processed');    
  });


  module.exports = data;
